import fetch from 'node-fetch'

const Card = ({card,quer}) => {
    console.log(card.datas)
    console.log(quer)

return <h1>{card.id} and name : {card.name} </h1>
}


export async function getStaticProps({query}){

    const res = await fetch(`http://localhost:3000/api/card/${query.Id}?dataId=56`)

   const card = {id:query.Id,name:query.dataId}
    return ({props:{card}})
}

export async function getStaticPaths(){

    const res = await fetch(`http://localhost:3000/api/all/discover`)
    const allpaths = await res.json()
 
    const paths = allpaths.map(data=> ({
        params: {id:toString(data.id)}
    }))
    return {
        paths,
        fallback:false
    }
}


export default Card
